import {useNavigate} from "react-router-dom";
import useFetch from "./useFetch";
import {Button, Col, Row} from "react-bootstrap";
import BookList from "./BookList";
import React from "react";
import ProductList from "./ProductList";

function Books () {
    let url = " http://localhost:8000/customer";
    const navigate = useNavigate();
    const {data : customers, isPending, error} = useFetch( url )
    const myTitle = "Customers"
    const myTitle14 = " Books at 14.99"
    return (
        <Row>
            <Col sm={3}>
            </Col>
            <Col sm={3}>
                { error && <div> Error: {error} </div> }
                {isPending && <div> Loading ...</div>}
                { customers && <BookList customers={customers} title={myTitle}/>}
                <Button onClick={() => navigate('/InsertCustomer')}>Add New Customer</Button>
            </Col>
        </Row>
    )
    let url2 = " http://localhost:8000/product";
    useFetch(url2)
    const myTitle2 = "Products"
    return (
            <Row>
                <Col sm={3}>
                </Col>
                <Col sm={3}>
                    { error && <div> Error: {error} </div> }
                    {isPending && <div> Loading ...</div>}
                    { products && <ProductList products={products} title={myTitle2}/>}
                </Col></Row>
        )
}
export default Books;


